measurements.description:
Fourteen slightly cupped flowers on one 54-cm inflorescence plus five partially open buds on one immature inflorescence; 
   sepals and petals light yellow overlaid oxblood red, darker midline, yellow edges;

   lip ivory overlaid burgundy distally, picotee, keels white;
   column pale yellow spotted darker interior surface, anther cap yellow;
   substance firm; texture matte.
